//SPDX-License-Identifier: Unlicense
pragma solidity ^0.8.0;

import "./LPT.sol";
import "./JMToken.sol";
import "./VJMToken.sol";
import "@openzeppelin/contracts/utils/math/Math.sol";
import "@uniswap/lib/contracts/libraries/Babylonian.sol";
import "@openzeppelin/contracts/access/Ownable.sol";

// indexed ->        search ,    
// unchecked ->      overflow   ->        
//                
//    unchecked     
/*
      (Swap)

    JMT token = 10000 
    ETH token = 20
     LiquidityPool Reserve   ,    
    A 100 JMT  ETH   
       10000*20 = 200000  
     A JMT100   
      10100  10100*20 = 202000  

        200000 
    202000  JMT ETH   

      x * 10100 = 200000    ( x  eth  )
     x   x = 200000/10100    
    x = 19.8019082 eth        (eth)reserve - x = 0.921980918 
       eth 0.921980918  (   ) 
*/
contract LiquidityPool is Ownable {
    event LiquidityAdded(address indexed _account);
    event LiquidityRemoved(address indexed _account);
    event TradedTokens(address indexed _account,uint256 _ethTraded,uint256 _jmtTraded);
    event Claimed(address indexed _account, uint256 _amount);

    struct DepositeInfo {        
        uint256 claimedTime; 
        uint256 amount; 
        uint32 state;
    }


    LPT lpToken; //  lp  
    JMToken jmtToken;
    VJMToken vJmt;

    uint256 ethReserve; //   
    uint256 jmtReserve;  //  jmt 
    uint32 lastBlockTimestamp;
    uint256 totalReserve; //   
    uint256 public decimals = 10**18;
    uint32 public APR = 571; // 
    uint32 private yearsDuration = 31536000;
    uint32 private dayDuration = 86400;
    mapping(address => DepositeInfo) public depositeInfos; 

    constructor () {
        ethReserve=0;
        jmtReserve=0;
    }

    modifier JonMatngOnly() {
        require(msg.sender == address(jmtToken), "JonMatng_ONLY");
        _;
    }
    // set funded reserve 
    function setFundedReserve() JonMatngOnly public {
        require(ethReserve != 0 && jmtReserve != 0,"RESERVE AMOUNT EMPTY");
        totalReserve = ethReserve*jmtReserve;
    }

    // lpt   
    function setLPTAddress(LPT _lpToken) external onlyOwner {
        require(address(lpToken) == address(0), "WRITE_ONCE");
        lpToken = _lpToken;
    }

    //  jmt   
    function setJmtCoinAddress(JMToken _jmtToken) external onlyOwner {
        require(address(jmtToken) == address(0), "WRITE_ONCE");
        jmtToken = _jmtToken;
    }
    // vJmt    
    function setVJMTCoinAddress(VJMToken _vJmt) external onlyOwner(){
        require(address(vJmt) == address(0), "WRITE_ONCE");
        vJmt = _vJmt;
    }

    //    
    function getReserves() external view returns (uint256, uint256) {
        return (ethReserve, jmtReserve);
    }

    //pool swap!
    function swap(address account, uint256 _jmtAmount) external payable {
        uint256 product = ethReserve * jmtReserve; //  
        uint256 amountToTransfer;
        uint256 amountToTake;
        uint256 totalAmountToTransfer;
        uint256 Commission = decimals; //

        // jmt -> eth, jmttoken == 0
        if (msg.value == 0) 
        {
            uint256 currentJMTBalance = jmtToken.balanceOf(address(this)); //      
            uint256 _jmtAmountMinusTax = _jmtAmount - ((2 * _jmtAmount) / 100); // (  - ) 
            uint256 addedBalance = jmtReserve + _jmtAmountMinusTax; //  jmt + (  - ) =   
            //require(addedBalance == currentJMTBalance, "DID_NOT_TRANSFER");

            uint256 x = product / (jmtReserve + _jmtAmountMinusTax); //  product   
            amountToTransfer = ethReserve - x; //   eth 
            amountToTake = (1 * amountToTransfer) / 100; //  
            totalAmountToTransfer = amountToTransfer - amountToTake; //   -  =  get eth 

            //     //  
            // https://kushgoyal.com/ethereum-solidity-how-use-call-delegatecall/ ->  
            (bool success, ) = account.call{value: totalAmountToTransfer}("");
            require(success, "TRANSFER_FAILED");
        } else { // eth -> jmt, jmttoken > 0 msg.value > 0  

            uint256 y = product / (ethReserve + msg.value);
            amountToTransfer = jmtReserve - y;
            amountToTake = (1 * amountToTransfer) / 100;
            totalAmountToTransfer = amountToTransfer - amountToTake;

            jmtToken.transfer(account, totalAmountToTransfer);

            Commission = (totalAmountToTransfer * 10) / 100;
            vJmt.transfer(account , Commission);
        }
        emit TradedTokens(account, msg.value, _jmtAmount);
        _update();
    }

    // pool  
    function deposit(uint256 jmtAmount, address account) external payable 
    {
        uint256 liquidity; //  
        uint256 totalSupply = lpToken.totalSupply(); // lp erc
        uint256 ethAmount = msg.value; //

        if (totalSupply > 0) {
            liquidity = Math.min(
                (ethAmount * totalSupply) / ethReserve,
                (jmtAmount * totalSupply) / jmtReserve
            );
        } else { // x
            liquidity = Babylonian.sqrt(ethAmount * jmtAmount);
        }

        lpToken.mint(account, liquidity); // transfer user => 
        if(depositeInfos[account].state == 1){
            uint256 vjmtAomount = (depositeInfos[account].amount * APR / 100) / yearsDuration / dayDuration; 
            uint256 claimableAmount = (block.timestamp - depositeInfos[account].claimedTime) * vjmtAomount;
            vJmt.transfer(account , claimableAmount * 100);
        }

        depositeInfos[account] = DepositeInfo({
            claimedTime: block.timestamp,
            amount: (depositeInfos[account].amount + liquidity),
            state: 1 
        });

        emit LiquidityAdded(account);
        _update();
    }

    //lp 
    function withdraw(address account) external 
    {
        uint256 liquidity = lpToken.balanceOf(account); //  lp   
        require(liquidity != 0, "NO_AVAILABLE_TOKENS");

        uint256 totalSupply = lpToken.totalSupply();
        //  
        uint256 ethAmount = (ethReserve * liquidity) / totalSupply;
        uint256 jmtAmount = (jmtReserve * liquidity) / totalSupply;

        if(depositeInfos[account].state == 1){
            uint256 vjmtAomount = (depositeInfos[account].amount * APR / 100) / yearsDuration / dayDuration; 
            uint256 claimableAmount = (block.timestamp - depositeInfos[account].claimedTime) * vjmtAomount;
            vJmt.transfer(account , claimableAmount * 10000);
            delete depositeInfos[msg.sender];
        }

        // 
        lpToken.burn(account, liquidity); // account  , lpt   

        //    
        (bool ethTransferSuccess, ) = account.call{value: ethAmount}("");
        bool jmtTransferSuccess = jmtToken.transfer(account, jmtAmount);

        require(ethTransferSuccess && jmtTransferSuccess, "FAILED_TRANSFER");
        emit LiquidityRemoved(account);
        _update();
    }


    function setDepositeInfo() public {
        depositeInfos[msg.sender].claimedTime = block.timestamp;
    }

    // LP 
    function claimReward() external returns (bool){
        require(depositeInfos[msg.sender].state == 1, "You are not participated");

        uint256 stakingDuration = block.timestamp - depositeInfos[msg.sender].claimedTime; //     
        uint256 persecondAmount = (depositeInfos[msg.sender].amount * APR / 100) / yearsDuration / dayDuration; //   
        uint256 claimableAmount = persecondAmount * stakingDuration; //  

        vJmt.transfer(msg.sender, claimableAmount * 10000); //vjmt:jmt 
        setDepositeInfo(); //    
        emit Claimed(msg.sender, claimableAmount);
        return true;
    }

    // LP   
    function claimableReward() public view returns(uint256) 
    {
        if(depositeInfos[msg.sender].state == 1){
            uint256 stakingDuration = block.timestamp - depositeInfos[msg.sender].claimedTime; //     
            uint256 persecondAmount = (depositeInfos[msg.sender].amount * APR / 100) / yearsDuration / dayDuration; //   
            uint256 claimableAmount = persecondAmount * stakingDuration; //  
            return (claimableAmount * 100);
        }else{
            return 0;
        }
    }

    // ,     
    function _update() private 
    {
        // uint32 blockTimestamp = uint32(block.timestamp % 2**32);
        // uint32 timeElapsed;
        // unchecked { //     
        //     timeElapsed = blockTimestamp - lastBlockTimestamp; 
        // }
        // if (timeElapsed > 0) {
            ethReserve = address(this).balance; //    eth 
            jmtReserve = jmtToken.balanceOf(address(this)); // jmt    
        //     lastBlockTimestamp = blockTimestamp; 
        // }
    }
}
